	INSERT INTO PLZ.Film VALUES (1,'Il Gladiatore','Il Gladiatore  il miglior film di sempre, datato 2000, magistralmente diretto da Ridley Scott ed interpretato da un grande Russell Crowe e daJoaquin Phoenix.',2000,9300,'USA',0,0,0,0,NULL,0),
	(2,'Titanic','Titanic  un colossal del 1997 diretto da James Cameron, con il quale vinse ben 11 statuette agli Oscar riproponendo sullo schermo la vera storia del naufragio del Titanic durante la sua prima traversata nellAtlantico.',1997,11700,'USA',0,0,0,0,NULL,0),
	(3,'Bastardi senza gloria','Bastardi senza Gloria  probabilmente il capolavoro della filmografia del grande regista Quentin Tarantino che lancia nel 2009 una rilettura della storia pi cupa dello scorso secolo.',2009,9180,'USA',0,0,0,0,NULL,0),
	(4,'Forrest Gump','Forrest Gump  un film che del 1994, diretto dal regista Robert Zemeckis che si inspira allomonimo romanzo di Winston Groom per portare sul grande schermo quello che divenne uno dei pi grandi successi cinematografici.',1994,8520,'USA',0,0,0,0,NULL,0),
	(5,'2012','2012  un disaster movie prodotto per il grande schermo nel 2009 e diretto dal regista Roland Emmerich a pochi anni dalla famosa profezia Maya secondo la quale il mondo sarebbe dovuto finire proprio nel 2012.',2009,9480,'USA',0,0,0,0,NULL,0),
	(6,'C''era una volta in America ','La New York degli anni Venti fa da scenario alle gesta di una piccola banda di ragazzini capeggiata da Max e Noodles. Entrambi ebrei, vivono per la strada tra scippi, piccoli furti, ricatti ai poliziotti di quartiere. Passano gli anni, arriva il Proibizionismo e una nuova opportunit di fare soldi in modo pi facile. Non sono pi i teppistelli di una volta, ora sono uomini disposti a tutto pur di trovare un loro posto al sole. La via  costellata di morte, sangue, ricatti, amori violati, tradimenti, amicizie infrante ed esili volontari. Le colpe per hanno sempre un prezzo da pagare e i debiti si pagano anche se a distanza di tempo. Anche quando tutto sembra ormai solo un ricordo annebbiato e rimane, forse, solo il rimpianto.',1984,13080,'Italia',0,0,0,0,NULL,0),
	(7,'Ladri di biciclette','Dopo il furto della propria bicicletta, mezzo che gli permetteva di lavorare, un uomo vaga per la citt con tutta la famiglia sperando di poterla ritrovare. Preso dalla disperazione non gli resta che rubarne una a sua volta ma viene bloccato dalla polizia, a questo punto il derubato commuovendosi lo lascia andare..',1948,5580,'Italia',0,0,0,0,NULL,0),
	(8,'Roma, Citt Aperta','Durante l''occupazione nazista di Roma, la polizia tedesca  sulle tracce di un ingegnere legato alla Resistenza, Giorgio Manfredi, che riesce a sfuggire alla perquisizione nel suo appartamento e si rifugia in casa di un amico. Un parroco, Don Pietro, impegnato nella lotta contro i nazisti, aiuta Giorgio nei contatti con la Resistenza, ma un''attrice che aveva avuto una relazione con l''ingegnere li tradisce e li fa arrestare. Torturati dai nazisti perch rivelino i nomi dei loro compagni, Giorgio e Don Pietro resistono eroicamente e, mentre l''ingegnere perde la vita sotto tortura, il parroco viene fucilato.',1945,6300,'Italia',0,0,0,0,NULL,0),
	(9,'Quasi Amici','Ispirato a una storia vera, questo film racconta la nascita di uninsolita amicizia tra Philippe, un aristocratico rimasto paraplegico a seguito di un incidente, e Driss un ragazzo con precedenti penali che vive in periferia. Driss viene infatti assunto come badante di Philippe e, dopo uniniziale diffidenza e numerose difficolt da parte di entrambi, riusciranno a instaurare un rapporto di grande empatia e sincerit, grazie anche al carattere schietto e spontaneo di Driss.Una pellicola emozionante e divertente che, con profonda ironia, fa riflettere sullimportanza dellamicizia e sulla bellezza delle piccole cose della vita.',2011,6720,'Francia',0,0,0,0,NULL,0),
	(10,'2001: Odissea nello spazio','Nel 2001, un misterioso oggetto di origine intelligente viene scoperto sulla Luna. A seguito di questo rinvenimento, una squadra di astronauti viene inviata in missione verso Giove; a supervisionare le operazioni, un computer di ultima generazione, l''infallibile HAL 9000.',1968,8460,'UK',0,0,0,0,NULL,0);
